package Easy;

import java.util.*;

public class IsSequence {

    public static void main(String[] args) {
        IsSequence isSequence = new IsSequence();
        String s = "leeeeetcode";
        String t = "";
        System.out.println(isSequence.isSubsequence(s, t));
    }

    public boolean isSubsequence(String s, String t) {
        Map<Character, Set<Integer>> myMap = new HashMap<>();
        for (int i = 0; i < t.length(); i++) {
            Set<Integer> set = myMap.get(t.charAt(i));
            if (null == set) {
                set = new TreeSet<>();
            }
            set.add(i);
            myMap.put(t.charAt(i), set);
        }
        for (Character c : myMap.keySet()) {
            System.out.println("Character " + c + " index " + myMap.get(c).toString());
        }

        int prevIndex = -1;
        for (int i = 0; i < s.length(); i++) {
            if (!myMap.containsKey(s.charAt(i))) {
                return false;
            }
            boolean found = false;
            Set<Integer> mySet = myMap.get(s.charAt(i));
            for (Integer index : mySet) {
                if (index > prevIndex) {
                    System.out.println("Found char " + s.charAt(i) + " at " + index);
                    prevIndex = index;
                    found = true;
                    break;
                }
            }
            if (!found) {
                return false;
            }
        }

        return true;
    }
}


